import React, { useState } from 'react';
import { Button, ToggleButton, ToggleButtonGroup } from "@mui/material";
import { useLocation } from 'react-router';
import { Link } from "react-router-dom";


function QuizOptions () {
    // get lesson # from URL
    const location = useLocation();
    const searchParams = new URLSearchParams(
        location.search
    );
    const lesson = searchParams.get("lesson");

    const [qNum, setQNum] = useState("0"); // 0 is all questions
    // q(uestion), a(nswer), n(either) 
    const [kanji, setKanji] = useState("q");
    const [kana, setKana] = useState("q");
    const [en, setEn] = useState("a");

    const handleQNum = (event, newQNum) => {
        setQNum(newQNum);
    };
    const handleKanji = (event, newKanji) => {
        setKanji(newKanji);
    };
    const handleKana = (event, newKana) => {
        setKana(newKana);
    };
    const handleEn = (event, newEn) => {
        setEn(newEn);
    };

    return (
        <div>
            <br/>
            <h1 className='page-title'>Lesson {lesson} Quiz</h1>
            <p>Number of Questions:</p>
            <ToggleButtonGroup
                value={qNum}
                exclusive
                onChange={handleQNum}
                aria-label="number of questions"
                >
                <ToggleButton value="0" aria-label="all">
                    All
                </ToggleButton>
                <ToggleButton value="5" aria-label="five">
                    5
                </ToggleButton>
                <ToggleButton value="10" aria-label="ten">
                    10
                </ToggleButton>
            </ToggleButtonGroup>
            <br/>

            <p>Question Type:</p>
            <p>Kanji</p>
            <ToggleButtonGroup
                value={kanji}
                exclusive
                onChange={handleKanji}
                aria-label="kanji"
                >
                <ToggleButton value="q" aria-label="question">
                    question
                </ToggleButton>
                <ToggleButton value="a" aria-label="answer">
                    answer
                </ToggleButton>
                <ToggleButton value="n" aria-label="none">
                    none
                </ToggleButton>
            </ToggleButtonGroup>
            <br/>
            <p>Kana</p>
            <ToggleButtonGroup
                value={kana}
                exclusive
                onChange={handleKana}
                aria-label="kana"
                >
                <ToggleButton value="q" aria-label="question">
                    question
                </ToggleButton>
                <ToggleButton value="a" aria-label="answer">
                    answer
                </ToggleButton>
                <ToggleButton value="n" aria-label="none">
                    none
                </ToggleButton>
            </ToggleButtonGroup>
            <br/>
            <p>English</p>
            <ToggleButtonGroup
                value={en}
                exclusive
                onChange={handleEn}
                aria-label="english"
                >
                <ToggleButton value="q" aria-label="question">
                    question
                </ToggleButton>
                <ToggleButton value="a" aria-label="answer">
                    answer
                </ToggleButton>
                <ToggleButton value="n" aria-label="none">
                    none
                </ToggleButton>
            </ToggleButtonGroup>
            <br/>

            <Link to={{
                pathname: "/quizzes",
                search: `?lesson=${lesson}&qnum=${qNum}&kj=${kanji}&kn=${kana}&en=${en}`
            }}><Button>Start Quiz</Button></Link>
        </div>
    );
};

export default QuizOptions;
